import React,{useEffect,useState} from "react"

  function EditPack(){

      const [packages,setPacks]=useState([])

      useEffect(()=>{
       
        fetch("http://localhost:8070/package/all").then((result)=>{
             result.json().then((resp)=>{

       // console.warn(resp)
        setPacks(resp)


             })
        })





      })

      console.warn(packages)
    
   return(
   <div>
   <div className="Edit">

   <h1>Get API</h1>

   <table style={{marginTop:'40px'}}>

     <tr>
      
     <th>Package Name</th>
         <th>Package ID</th>
         <td>Destination</td>
         <td>NumberofDays</td>
         <td>NumberofPassengers</td>
         <td>Hotel</td>
         <td>Transport</td>
         <td>TourGuide</td>
         <td>TotalPrice(Rs)</td>




     </tr>

   {
     packages.map((packages)=>{
       <tr>
          <td>{packages.name}</td>
          <td>{packages.packId}</td>
          <td>{packages.destination}</td>
          <td>{packages.numofdays}</td>
          <td>{packages.nopass}</td>
          <td>{packages.hotel}</td>
          <td>{packages.transport}</td>
          <td>{packages.tourGuide}</td>
          <td>{packages.totPrice}</td>
       </tr>
     })   


    }
   </table>
     
   </div>

  </div>
   );
    
   }
export default EditPack;
